(1283, 183, 'firm_description', 'Within the customer teams in the Cloud support environment, your role as Technical Lead is to help develop the technical and business skills of IT Support Technicians.\r\n\r\nWorking closely with the team leader, you ensure that IT Support Technicians in your product environment develop their skills and expertise.\r\n\r\nAdministratorem danych jest OVH Sp. z o.o.. Dane zbierane są dla obecnego jak i przyszłych procesów rekrutacji. Ma Pani/Pan prawo dostępu do treści swoich danych oraz ich poprawiania. Podanie danych w zakresie określonym postanowieniami ustawy z dnia 26 czerwca 1974 r. Kodeks pracy (Dz. U. z 1998 r. Nr 21, poz. 94 z późn. zm.) oraz aktów wykonawczych jest obowiązkowe. Podanie dodatkowych danych osobowych jest dobrowolne i następuje na podstawie zgody umieszczonej poniżej:\r\n\r\nWyrażam zgodę na przetwarzanie przez OVH Sp. z o.o. moich dodatkowych danych osobowych dla potrzeb obecnego jak i przyszłych procesów rekrutacji.\r\n\r\nW razie rezygnacji z dalszego udziału w procesie rekrutacji ma Pani/Pan prawo złożyć żądanie usunięcia Pani/Pana danych osobowych, które spowoduje ich niezwłoczne usunięcie przez OVH Sp. z o.o.'),
(1284, 183, '_firm_description', 'field_5f57c6ef4ced9'),
(1285, 183, 'firm_name', 'OVH Sp. z o.o.'),
(1286, 183, '_firm_name', 'field_5f57c7394ceda'),
(1287, 183, 'offer_responsibilities', ' <ul class=\"current-jobs-offers__list-group\">\r\n                                <li class=\"current-jobs-offers__list-item\">Ensure and provide continuous training for IT\r\n                                    Support Technicians in the relevant environment</li>\r\n                                <li class=\"current-jobs-offers__list-item\">Identify continuous training needs of\r\n                                    technical support advisors and refer them to managers and the training center</li>\r\n                                <li class=\"current-jobs-offers__list-item\">Coordinate and synchronize with the training\r\n                                    center so that product, technical and other developments are well known and\r\n                                    understood by Customer Advisors</li>\r\n                                <li class=\"current-jobs-offers__list-item\">Participate in designing training modules for\r\n                                    specific topics as well as continuous development</li>\r\n                                <li class=\"current-jobs-offers__list-item\">Participate in training modules from the\r\n                                    training center (new products, features etc.)</li>\r\n                                <li class=\"current-jobs-offers__list-item\">Evaluate the effectiveness and relevance of\r\n                                    training courses (identify gaps in initial training, changes in segments, etc.)</li>\r\n                                <li class=\"current-jobs-offers__list-item\">Propose and carry out individual and group\r\n                                    action plans (e.g. workshops, briefing notes) that contribute to the skills\r\n                                    development of Customer Advisors</li>\r\n</ul>'),
(1288, 183, '_offer_responsibilities', 'field_5f57c7444cedb'),
(1289, 183, 'offer_requirements', '<ul class=\"current-jobs-offers__list-group\">\r\n                                <li class=\"current-jobs-offers__list-item\">Ensure and provide continuous training for IT\r\n                                    Support Technicians in the relevant environment</li>\r\n                                <li class=\"current-jobs-offers__list-item\">Identify continuous training needs of\r\n                                    technical support advisors and refer them to managers and the training center</li>\r\n                                <li class=\"current-jobs-offers__list-item\">Coordinate and synchronize with the training\r\n                                    center so that product, technical and other developments are well known and\r\n                                    understood by Customer Advisors</li>\r\n                                <li class=\"current-jobs-offers__list-item\">Participate in designing training modules for\r\n                                    specific topics as well as continuous development</li>\r\n                                <li class=\"current-jobs-offers__list-item\">Participate in training modules from the\r\n                                    training center (new products, features etc.)</li>\r\n                                <li class=\"current-jobs-offers__list-item\">Evaluate the effectiveness and relevance of\r\n                                    training courses (identify gaps in initial training, changes in segments, etc.)</li>\r\n                                <li class=\"current-jobs-offers__list-item\">Propose and carry out individual and group\r\n                                    action plans (e.g. workshops, briefing notes) that contribute to the skills\r\n                                    development of Customer Advisors</li>\r\n                            </ul>'),
