(1303, 185, 'firm_description', 'With more than 1.5 million customers worldwide, OVHcloud is the European leader of cloud computing and the 3rd largest web hosting provider in the world. Our company employs more than 2,200 people and our teams are growing rapidly. With 30 datacenters and a commercial presence on 5 continents, we manufacture our own servers and thus control our entire industrial chain. We defend an innovative and different cloud, which respects the European values of freedom of choice, transparency, openness to standards and protection of privacy.\r\n INSERT INTO `wp_postmeta` (`meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
