(73, 1, '2020-09-05 17:33:39', '2020-09-05 15:33:39', '27.08.2020 o 15:00 zapraszamy na wyjątkowe spotkanie z udziałem prelegentów znanych Wam już z SO/DO MeetUpów. Tym razem wspólnie podsumujemy sezon podczas 10-minutowych prelekcji.\r\n\r\nBędziecie mogli usłyszeć m.in o sztucznej inteligencji i o tym jak ułatwia ona pracę deweloperów. Nie zabraknie prelekcji o Azure DevOps i MKDocs. Znajdzie się coś dla fanów AWS SSM Session Manager oraz dla tych, którzy szukają nowoczesnego narzędzia dla CI/CD pipeline. Poznacie także proste triki, które poprawią jakość IaC oraz dowiecie się dlaczego i do czego warto używać Microsoft Graph. A to tylko niektóre z zaplanowanych tematów.\r\n\r\nKoniecznie śledźcie wydarzenie na Facebook’u i na naszej stronie. To właśnie tam systematycznie wrzucamy opisy wszystkich prelekcji oraz nowe tematy. My już odliczamy dni do tego wydarzenia – nie może Was zabraknąć!', 'Na zakończenie sezonu SO/DO MeetUpów 2019/20 – lightning talk!', '', 'publish', 'open', 'open', '', 'na-zakonczenie-sezonu-so-do-meetupow-2019-20-lightning-talk', '', '', '2020-09-05 17:35:33', '2020-09-05 15:35:33', '', 0, 'http://secops.local/?p=73', 0, 'post', '', 0),
