(78, 1, '2020-09-05 17:34:25', '2020-09-05 15:34:25', '27.08.2020 o 15:00 zapraszamy na wyjątkowe spotkanie z udziałem prelegentów znanych Wam już z SO/DO MeetUpów. Tym razem wspólnie podsumujemy sezon podczas 10-minutowych prelekcji.\r\n\r\nBędziecie mogli usłyszeć m.in o sztucznej inteligencji i o tym jak ułatwia ona pracę deweloperów. Nie zabraknie prelekcji o Azure DevOps i MKDocs. Znajdzie się coś dla fanów AWS SSM Session Manager oraz dla tych, którzy szukają nowoczesnego narzędzia dla CI/CD pipeline. Poznacie także proste triki, które poprawią jakość IaC oraz dowiecie się dlaczego i do czego warto używać Microsoft Graph. A to tylko niektóre z zaplanowanych tematów.\r\n\r\nKoniecznie śledźcie wydarzenie na Facebook’u i na naszej stronie. To właśnie tam systematycznie wrzucamy opisy wszystkich prelekcji oraz nowe tematy. My już odliczamy dni do tego wydarzenia – nie może Was zabraknąć!', 'Na zakończenie sezonu SO/DO MeetUpów 2019/20 – lightning talk!', '', 'inherit', 'closed', 'closed', '', '73-revision-v1', '', '', '2020-09-05 17:34:25', '2020-09-05 15:34:25', '', 73, 'http://secops.local/2020/09/05/73-revision-v1/', 0, 'revision', '', 0),
(79, 1, '2020-09-05 17:37:26', '2020-09-05 15:37:26', 'Za highly available można uznać uruchomienie wielu instancji aplikacji na wielu komputerach. Jednak omawiany termin to coś więcej i właśnie o tym opowie w swoim wystąpieniu Rafał Leszko. Usłyszymy m.in. o 5 poziomach HA oraz poznamy rzeczywiste scenariusze, których Rafał wraz z zespołem doświadczył podczas projektowania Hazelcast. Omówimy też przykłady powiązanych funkcjonalności, których możemy potrzebować m.in. zone aware partition groups czy WAN replication.\r\n\r\nPracowaliście kiedyś z Kubernetesem? Wiecie, że jest on dobrą platformą bazową do aplikacji CI? Oczywiście, w połączeniu z łatwym skalowaniem aplikacji uruchamianych wewnątrz klastrów. W trakcie drugiej prelekcji Jakub Czapliński przedstawi dostępne na rynku rozwiązania, które wykorzystują Kubernetesa, a równocześnie są odmienne w obsłudze, konfiguracji i podejściu do tworzenia i uruchamiania pipeline’ów. \r\n\r\nPamiętajcie, że jeśli po wystąpieniach będziecie mieli jakieś pytania, to nasi prelegenci na pewno chętnie na nie odpowiedzą! \r\n\r\nZapraszamy również do subskrypcji naszego kanału na YouTubie, by nie przegapić żadnego MeetUpu. Znajdziecie tam także nagrania z poprzednich spotkań. ', 'Kubernetes i High Availability na ostatnim sierpniowym SO/DO MeetUpie', '', 'publish', 'open', 'open', '', 'kubernetes-i-high-availability-na-ostatnim-sierpniowym-so-do-meetupie', '', '', '2020-09-05 17:37:26', '2020-09-05 15:37:26', '', 0, 'http://secops.local/?p=79', 0, 'post', '', 0),
