(83, 1, '2020-09-05 17:38:25', '2020-09-05 15:38:25', 'Infoshare, największa konferencja technologiczna w tej części Europy, to 6 dni wypełnionych prelekcjami z różnych specjalistycznych dziedzin i nowymi możliwościami networkingu. W tym roku organizatorzy prezentują agendę konferencji w zupełnie nowym kształcie. Codziennie uczestnicy będą mogli oglądać transmisję na żywo na 2 równoległych kanałach. Tegoroczny program obejmuje prelekcje przedstawiane na 9 scenach tematycznych (w tym aż na 7 scenach technologicznych), które dostarczą solidnej dawki wiedzy i inspiracji: DevTrends Stage, Inspire Stage, Backend Stage, Marketing Stage, Front-end Stage, DeepTech Stage, Security Stage, ITLeaders (NOWOŚĆ) oraz DataTech Stage. \r\n\r\nWśród prelegentów Infoshare można spotkać specjalistów z takich firm, jak IBM, Spotify czy Tinder, a także niezależnych specjalistów. W agendzie Infoshare 2020 Online nie zabraknie miejsca na nowe możliwości nawiązywania kontaktów biznesowych, przygotowanych specjalnie na to wydarzenie. Można spotkać się z innymi deweloperami i ekspertami, poznać ludzi z branży, dzielić się swoimi pomysłami i zbudować swój ekspercki wizerunek.\r\n\r\nBilet Conference Pass daje Ci możliwość dostępu do live-streamingu z każdego miejsca oraz do nagrań z prelekcji. Z kodem is20-sys-devops bilety 15% taniej!\r\n\r\nMy będziemy całym SO/DO Teamem 🙂 Zapraszamy, żebyście stali się częścią innowacyjnej społeczności – większej niż kiedykolwiek, bo tegoroczna konferencja nie ma fizycznych granic.', 'SysOps/DevOps Polska community partnerem Infoshare 2020', '', 'publish', 'open', 'open', '', 'sysops-devops-polska-community-partnerem-infoshare-2020', '', '', '2020-09-05 17:38:25', '2020-09-05 15:38:25', '', 0, 'http://secops.local/?p=83', 0, 'post', '', 0),
