(185, 1, '2020-09-08 21:03:43', '2020-09-08 19:03:43', 'Within the customer teams in the Cloud support environment, your role as Technical Lead is to help develop the technical and business skills of IT Support Technicians.\r\n\r\nWorking closely with the team leader, you ensure that IT Support Technicians in your product environment develop their skills and expertise.\r\n\r\nAdministratorem danych jest OVH Sp. z o.o.. Dane zbierane są dla obecnego jak i przyszłych procesów rekrutacji. Ma Pani/Pan prawo dostępu do treści swoich danych oraz ich poprawiania. Podanie danych w zakresie określonym postanowieniami ustawy z dnia 26 czerwca 1974 r. Kodeks pracy (Dz. U. z 1998 r. Nr 21, poz. 94 z późn. zm.) oraz aktów wykonawczych jest obowiązkowe. Podanie dodatkowych danych osobowych jest dobrowolne i następuje na podstawie zgody umieszczonej poniżej:\r\n\r\nWyrażam zgodę na przetwarzanie przez OVH Sp. z o.o. moich dodatkowych danych osobowych dla potrzeb obecnego jak i przyszłych procesów rekrutacji.\r\n\r\nW razie rezygnacji z dalszego udziału w procesie rekrutacji ma Pani/Pan prawo złożyć żądanie usunięcia Pani/Pana danych osobowych, które spowoduje ich niezwłoczne usunięcie przez OVH Sp. z o.o.', 'Junior DevOps Analyst', '', 'publish', 'closed', 'closed', '', 'junior-devops-analyst', '', '', '2020-09-08 21:03:43', '2020-09-08 19:03:43', '', 0, 'http://secops.local/?post_type=offers-job&#038;p=185', 0, 'offers-job', '', 0),
