(242, 1, '2020-09-09 22:27:47', '2020-09-09 20:27:47', 'Rosnąca popularność Kubernetesa sprawiła, że certyfikaty CKAD i CKA są coraz bardziej cenione przez pracodawców. Według obiegowych opinii, egzamin CKAD jest całkiem sporym wyzwaniem, dlatego Dominik podczas prezentacji postara się odpowiedzieć na pytanie, czy jest to słuszne. Podzieli się również swoimi doświadczeniami – mając nadzieję, że okażą się one pomocne 😊 - zarówno z przygotowań, jak i samego egzaminu. Z wystąpienia dowiemy się także - jakich zadań można się spodziewać, a jakich niekoniecznie. W kilku słowach usłyszymy też, czym różni się codzienna praca z Kubernetesem od zadań egzaminacyjnych.\r\n\r\nDominik Andruszak - przez ostatnią dekadę programował w paru różnych językach, aktualnie pracuje nad aplikacjami cloud-native w Pythonie i Go z wykorzystaniem Kubernetesa. W wolnych chwilach zdecydowanie za dużo czasu poświęca na guilty pleasures - czytanie artykułów na Medium i sprawdzanie nowości z polskiego rapu.\r\n', 'SysOps/DevOps Gdańsk MeetUp #13', '', 'publish', 'closed', 'closed', '', 'sysops-devops-gdansk-meetup-13', '', '', '2020-09-09 22:27:47', '2020-09-09 20:27:47', '', 0, 'http://secops.local/?post_type=event&#038;p=242', 0, 'event', '', 0),
